const ProjectList = ({projects}) => {


  return (
    <div>
    {Object.keys(projects).map(project => {
      return(
    <div key={project}>
    <label>{projects[project]}</label>
    <p>{project.description}</p>
    <p>{project.tool}</p> 
    </div>)})}
    </div>
  )
}

export default ProjectList;
